 the buildings are grouped close together. Darnassus is open to the sky, and the graceful bridges spanning the lake around which it is built set the buildings wide apart. The elegant bridges, beautiful groves, and leaf-covered pathways that dot the city's landscape are testaments to the night elves' reverence for nature. One of Darnassus's most notable structures is the stunning Temple of the Moon, the center of worship for High Priestess Tyrande Whisperwind and her Sisters of Elune. The prime reason why the city's population is so low is that it is isolated: Teldrassil is a small island away from the main mass of Azeroth, and the only way to gain access from another continent is to fly or sail to Rut'theran Village, a small settlement at the base of Teldrassil, and from there step into the glowing portal to the city proper. Darnassus is home to night elves of all vocations and remains a symbol of the night elves' rich culture and glorious history.",g={h(-12,{ach(5848,{awp=40200,r=2,requireSkill=356,u=40,g={crit(63609,{achID=5851,awp=40200,id=1})}}),ach(5842,{awp=40200,r=2,requireSkill=185,u=40,g={crit(63554,{achID=5845,awp=40200,id=1,u=40})}}),crit(11078,{achID=3556,awp=30202,e=101,id=2,r=2}),crit(11139,{achID=3581,awp=30202,e=101,id=2,r=1}),crit(18290,{achID=6030,awp=40300,e=1,id=3,providers={{"i",74142}},r=2})}),flt(101,{awp=50004,pb=1,sym={{"select","speciesID",479,478,452,419}}}),h(-31,{faction(69,{OnTooltip=_.OnTooltipDB.RuneclothTurnIns,providers={{"i",45579}},r=2,g={crit(5328,{achID=948,awp=30002,id=2,r=2,u=11}),crit(5328,{achID=2760,awp=30200,id=2,r=2,u=31})}}),faction(1134,{awp=40003,maps={84},providers={{"i",64882}},r=2,u=40,g={crit(16826,{achID=948,awp=30002,id=4,r=2,u=11})}})}),h(-32,{fp(457,{awp=40001,coords={{36.61,47.82,89}},crs={40552},r=2})}),h(-44,{prof(356,{i(67414,{awp=40001,b=1,description="Fishing Daily Quest Reward",providers={{"n",4156}},q=1,sourceQuests={26414,26420,26442,26488,26536,26543,26556,26557,26572,26588,29317,29319,29320,29321,293