. The trees, land and creatures are twisted and evil, violent and wild. Cursed ancients and furbolg maul any who come close, and satyrs hold depraved court near tainted moonwells. The animals within are mad and brutal and have no fear of humanoids. The undead and demons that survived the Third War fled here as well, and hide in the deep tangles. Felwood is a chaos of battling creatures, and blood soaks the ground. The infamous Shadow Council, a group of orc warlocks loyal to the Burning Legion, hides somewhere within.\n\nAlliance heroes, particularly druids, make forays into the cursed wood in attempts to destroy some of the larger menaces, root out the Shadow Council, and perhaps, some day, restore the land to its former legacy.",petBattleLvl=14,g={h(-12,{ach(853,{crit(1499,{achID=43,awp=30002,id=19})}),ach(4931,{awp=40003,sourceQuests={27995,27997,28126,28128,28129,28148,28213,28214,28228,28264,28288,28338,28340,28341,28342,28358,28359,28364,28366,28368,28374,28389},g={crit(6110,{achID=1678,awp=30002,id=1})}})}),flt(101,{awp=50004,pb=1,sym={{"select","speciesID",406,420}},g={p(500,{awp=50004,description="Can be found around Shatter Scar Vale near Infernal Sentries.",npcID=62317,pb=1,g={crit(21722,{achID=6585,awp=50004,id=43,pb=1})}}),p(497,{awp=50004,npcID=62314,pb=1,g={crit(21723,{achID=6585,awp=50004,id=87,pb=1}),crit(21723,{achID=6587,awp=50004,id=24,pb=1,u=17})}}),p(498,{awp=50004,npcID=62315,pb=1,g={crit(21724,{achID=6585,awp=50004,id=88,pb=1})}}),p(499,{awp=50004,npcID=62316,pb=1,g={crit(21725,{achID=6585,awp=50004,id=89,pb=1})}})}}),h(-30,{exp(1765,{crit(1445,{achID=853,awp=30002,id=7})}),exp(1997),exp(1761,{crit(1450,{achID=853,awp=30002,id=12})}),exp(2479,{crit(1449,{achID=853,awp=30002,id=11})}),exp(1762,{crit(1401,{achID=853,awp=30002,id=2})}),exp(1767,{crit(1403,{achID=853,awp=30002,id=4})}),exp(2480,{crit(1448,{achID=853,awp=30002,id=10})}),exp(2618,{crit(1404,{achID=853,awp=30002,id=5})}),exp(1763,{crit(1446,{achID=853,awp=30002,id=8})}),exp(2478,{cr