, War Golems, and Elementals resides in this dark, mountainous area.\n\nThe climate is very similar to Burning Steppes, as it was the same catastrophe that blackened both: the summoning of Ragnaros. The Searing Gorge is a part of Khaz Modan. Before being shattered by the summoning it was a mountainous region, part of the Redridge Mountains.\n\nLarge mining operations take place in The Cauldron, a giant excavation site forming a huge rift in the middle of the Searing Gorge. The Slag Pit lies within The Cauldron and is an underground mining site rich with multiple types of ore. The mining work is mainly done by slave labor, which consists for the most part of captured enemies.\n\nEver since the Dark Iron dwarves' capital, Thaurissan, was destroyed by the summoning of Ragnaros, they have searched for a landmass to control for their filthy, industrious works. The Searing Gorge was the obvious choice due to a low military presence, scarce population, few settlements, and high vulnerability. The dwarven garrisons were soon overrun by a massive Dark Iron invasion which forced them to retreat to Loch Modan and seal the passage.",petBattleLvl=13,g={h(-12,{ach(774,{crit(1291,{achID=42,awp=30002,id=14})}),ach(4910,{awp=40001,sourceQuests={27964,27979,28035,28064,28099},g={crit(5932,{achID=1676,awp=30002,id=1})}})}),flt(101,{awp=50004,pb=1,sym={{"select","speciesID",415}},g={p(427,{awp=50004,npcID=61420,pb=1,g={crit(21665,{achID=6586,awp=50004,id=3,pb=1})}}),p(423,{awp=50004,npcID=61383,pb=1,g={crit(21627,{achID=6586,awp=50004,id=39,pb=1}),crit(21297,{achID=2557,awp=30002,id=8,u=30})}}),p(428,{awp=50004,npcID=61425,pb=1,g={crit(21666,{achID=6586,awp=50004,id=46,pb=1})}})}}),h(-30,{exp(1957,{crit(1131,{achID=774,awp=30002,id=4})}),exp(1445,{crit(15121,{achID=774,awp=30002,id=9})}),exp(1959,{crit(1135,{achID=774,awp=30002,id=7})}),exp(1442,{crit(1129,{achID=774,awp=30002,id=2})}),exp(247,{crit(1134,{achID=774,awp=30002,id=6})}),exp(5615),exp(246,{crit(1130,{achID=774,awp=30002,id