er has passed (2 hours). Aeonaxx is often thought of as \"the rare spawn of Blood Seeker.\" Simply put, this means that there is a small chance for Aeonaxx to spawn instead of Blood Seeker whenever a spawn is due.",g={mnt(88718,{awp=40001,b=1,itemID=63042,lvl=70,q=4})}}),n(50059,{awp=40001,coords={{32.8,76.4,207},{37.6,81.6,207},{43.6,87.8,207},{45.8,84.2,207}},g={s(211110,67237,{awp=40001,f=4,lvl=83,q=3})}}),n(49822,{awp=40001,coords={{61.2,22.6,207}},description="Found inside Crumbling Depths, requires the daily quest Underground Economy. Use the bomb \"Ricket's Tickers\" in the central cavern to reach the cave where Jadefang spawns.",g={p(279,{awp=40001,b=1,itemID=64494,npcID=48982,q=1,spellID=91343})}}),n(50060,{awp=40001,coords={{55,25.6,207}},g={s(211111,67238,{awp=40001,f=7,lvl=83,q=3})}})}}),h(-58,{awp=40001,g={n(45408,{awp=40001,coords={{56.8,13.2,207}},g={s(210119,65907,{awp=40001,b=1,f=9,minReputation={1171,3000},q=1}),i(62342,{awp=40001,b=1,f=55,lvl=85,minReputation={1171,9000},q=3}),i(62344,{awp=40001,b=1,f=55,lvl=85,minReputation={1171,9000},q=3}),i(62347,{awp=40001,b=1,f=55,lvl=85,minReputation={1171,9000},q=3}),i(62321,{awp=40001,b=1,f=55,lvl=85,minReputation={1171,9000},q=3}),i(62352,{awp=40001,b=1,f=52,lvl=85,minReputation={1171,21000},q=3}),i(62351,{awp=40001,b=1,f=52,lvl=85,minReputation={1171,21000},q=3}),i(62350,{awp=40001,b=1,f=52,lvl=85,minReputation={1171,21000},q=3}),i(62348,{awp=40001,b=1,f=52,lvl=85,minReputation={1171,21000},q=3}),i(226463,{awp=40001,b=2,description="This version is only visible on the vendor when you aren't at the required reputation to purchase it yet on your current character.",f=55,lvl=85,minReputation={1171,42000},q=7}),i(226462,{awp=40001,b=2,description="This version is only visible on the vendor when you aren't at the required reputation to purchase it yet on your current character.",f=55,lvl=85,minReputation={1171,42000},q=7}),i(226460,{awp=40001,b=2,description="This version is only visible on the vendor when y